import React from 'react'

const cards = (props) => {
	const {id,name,email} = props;
	return (
		<div className="tc bg-light-green dib br3 pa3 ma3 grow bw2 shadow-5">
			<img alt="robo friends" src={`https://robohash.org/${id}?200x200` }/>
			<div>
				<h2>{`I am ${name}`}</h2>
				<p>{email}</p>
			</div>
		</div>

	)
}

export default cards;
